objetoCompra:
Prestação de serviços técnicos especializados para manutenção, suporte, operação e disponibilidade da plataforma digital de Carteira de
Identidade Profissional CIP, incluindo:
1. A manutenção do aplicativo móvel;
2. A preservação do acesso e da validade das carteiras digitais já emitidas;
3. A manutenção dos mecanismos de validação por QR Code;
4. O suporte técnico necessário à continuidade do serviço; e 
5. De forma excepcional, a emissão de novas carteiras digitais apenas quando estritamente necessário, inclusive para cumprimento de determinações judiciais ou para evitar prejuízo relevante à continuidade do serviço público.
